import { StyleSheet, Text, TouchableOpacity, View } from "react-native";
import React from "react";

const YouPage = () => {
  return (
    <View>
      <Text>YouPage</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default YouPage;
